                    "alm-examples": "[\n  {\n    \"apiVersion\":\"kubevirt.io/v1alpha3\",\n    \"kind\":\"KubeVirt\",\n    \"metadata\": {\n      \"name\":\"kubevirt\",\n      \"namespace\":\"kubevirt\"\n    },\n    \"spec\": {\n      \"imagePullPolicy\":\"Always\"\n    }\n  }\n]\n",
